    internal static class HopfieldNetworkWeightsFactory
    {
        internal static int[,] WeightsForHebbianLearningOfDigits(List<int> digits)
        {
            int[,] weights;

            string digitsString = digits.Aggregate(string.Empty, (currentDigitsString, digit) => currentDigitsString + $"{digit} ").Trim();

            bool digitFound = MultipleDigits.TryGetValue(digitsString, out weights);
            if (!digitFound)
            {
                throw new ArgumentException("incorrect digits");
            }

            return weights;
        }

